import React, { useEffect, useState } from "react";
import { Iphone } from "./components/Iphone";
import Loading from "./components/Loading";

const App = () => {
	const { display, setDisplay } = useState(false);

	useEffect(() => {
		setTimeout(() => {
			setDisplay(true);
		}, 3000);
	}, [setDisplay]);

	return display ? <Iphone /> : <Loading />;
};

export default App;
